import React, { Fragment } from "react";
import Input from "../layout/form/Input";

const SignIn = () => {
  return (
    <Fragment>
      <h2>Sign In</h2>
      <form>
        <Input
          content={"Email"}
          placeholder={"Please Enter An Email"}
          type={"email"}
        ></Input>
        <Input
          content={"Password"}
          placeholder={"Please Enter Your Last Email"}
          type={"password"}
        ></Input>
        <button type="submit">Submit</button>
      </form>
    </Fragment>
  );
};

export default SignIn;
